import { CartProvider, useCart } from "react-use-cart";
import Navbar from "../Navbar";
import Header from "../Header";
import { Col, Container, Row } from "reactstrap";



function Allcart() {
  return (
    <CartProvider>
      <Navbar />
      <Header />
      <br></br>
      <br></br>
      <Page />
      <Cart />
    </CartProvider>
  );
}
export default Allcart
